import EDIT from "@/table/table-xtqx/table-cdgl/edit.vue";
export default {
  props: {
    id: ""
  },
  data: function data() {
    return {
      form: {},
      dialog_edit_showing: false,
      menu: {
        id: ''
      }
    };
  },
  mounted: function mounted() {
    console.log(this.id);
    this.Reload();
  },
  methods: {
    Reload: function Reload() {
      var _this = this;

      this.axios.get('/guanqu/web/menus/' + this.id).then(function (res) {
        _this.form = res.data;
      });
    },
    del: function del() {
      var _this2 = this;

      this.$confirm("您确定删除该菜单吗?", "", {
        confirmButtonText: "确定",
        cancelButtonText: "取消",
        type: "warning"
      }).then(function () {
        _this2.axios.delete('/guanqu/web/menus/' + _this2.id).then(function (res) {
          // this.form = res.data;
          _this2.$emit("closewindows");

          _this2.$message({
            type: "success",
            message: "删除菜单成功!"
          });
        });
      }).catch(function () {
        _this2.$message({
          type: "error",
          message: "已取消删除"
        });
      });
    },
    openEdit: function openEdit() {
      this.menu.id = this.form.id;
      this.dialog_edit_showing = true;
    },
    close: function close() {
      this.$emit("closewindows");
    }
  },
  computed: {},
  components: {
    EDIT: EDIT
  }
};
